public class IndexTest {

    public static String CONTENT = "<h2 style=\"text-align: center;\"><span style=\"color: #ba372a; background-color: #f1c40f;\">11111111111</span></h2><p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/jpeg;base64,\" alt=\"\" width=\"178\" height=\"178\" />";

    public static void main(String[] args) {
        int index1 = CONTENT.indexOf("<img");
        String sub = CONTENT.substring(index1);
        int index2 = sub.indexOf("/>");
        System.out.println(index1);
        System.out.println(CONTENT.substring(index1, index2 + 1));
    }
}
